{
	"$schema": "./node_modules/@angular/cli/lib/config/schema.json",
	"version": 1,
	"newProjectRoot": ".",
	"projects": {
		"angularfire": {
			"projectType": "library",
			"root": "src",
			"sourceRoot": "src",
			"prefix": "angularfire",
			"architect": {
				"build": {
					"builder": "@angular-devkit/build-angular:ng-packagr",
					"options": {
						"tsConfig": "tsconfig.json",
						"project": "src/ng-package.json"
					}
				},
				"test": {
					"builder": "@angular-devkit/build-angular:karma",
					"options": {
						"polyfills": [
							"zone.js",
							"zone.js/testing"
						],
						"tsConfig": "tsconfig.spec.json",
						"karmaConfig": "karma.conf.js"
					}
				},
				"lint": {
					"builder": "@angular-eslint/builder:lint",
					"options": {
						"lintFilePatterns": [
							"src/**/*.ts",
							"src/**/*.html"
						]
					}
				}
			}
		}
	},
	"cli": {
		"packageManager": "npm",
		"analytics": "86795b8f-9036-4a53-929c-a7303453d677"
	}
}

const tsParser = require('@typescript-eslint/parser');
const js = require('@eslint/js');
const globals = require('globals');
const ts = require('@typescript-eslint/eslint-plugin');
const ng = require('@angular-eslint/eslint-plugin');
const esImport = require('eslint-plugin-import');

module.exports = [
  {
    files: ['**/*.ts'],
    plugins: {
      '@typescript-eslint': ts,
      '@angular-eslint': ng,
      import: esImport,
    },
    languageOptions: {
      parser: tsParser,
      globals: {
        ...globals.browser,
      },
      parserOptions: {
        project: ['tsconfig.build.json', 'tsconfig.json', 'tsconfig.spec.json'],
      },
    },
    rules: {
      ...js.configs.recommended.rules,
      ...ts.configs['recommended-requiring-type-checking'].rules,
      ...ts.configs['stylistic-type-checked'].rules,
      ...ng.configs.recommended.rules,
      ...esImport.configs.errors.rules,
      // eslint/js rules
      'no-undef': 'off',
      'no-redeclare': 'off',
      'prefer-arrow-callback': 'error',
      'curly': 'error',
      'no-dupe-class-members': 'off',
      "no-restricted-imports": ["error", "rxjs/Rx"],
      "no-console": ["error", {allow: ['log', 'error', 'warn']}],
      'sort-imports': [
        'error',
        {
          ignoreDeclarationSort: true,
        },
      ],
      // @typescript-eslint rules
      '@typescript-eslint/prefer-nullish-coalescing': 'off', // require `strictNullChecks`
      '@typescript-eslint/no-explicit-any': 'off',
      '@typescript-eslint/no-unsafe-assignment': 'off',
      '@typescript-eslint/no-unsafe-member-access': 'off',
      '@typescript-eslint/no-unsafe-call': 'off',
      '@typescript-eslint/no-unsafe-return': 'off',
      '@typescript-eslint/no-unsafe-declaration-merging': 'off',
      '@typescript-eslint/no-unsafe-argument': 'off',
      '@typescript-eslint/no-floating-promises': 'off',
      '@typescript-eslint/no-unnecessary-type-assertion': 'off',
      '@typescript-eslint/no-redundant-type-constituents': 'off', // causing pipeline error in src/compat/firestore/utils.spec.ts
      '@typescript-eslint/no-non-null-assertion': 'error',
      "@typescript-eslint/member-ordering": ["error", {
        "default": [
          "static-field",
          "instance-field",
          "static-method",
          "instance-method"
        ]
      }],
      '@typescript-eslint/no-unused-vars': [
        'error', {args: "after-used", "argsIgnorePattern": "^_"}
      ],
      // @angular-eslint rules
      '@angular-eslint/directive-selector': [
        'error',
        {
          type: 'attribute',
          prefix: 'app',
          style: 'camelCase',
        },
      ],
      '@angular-eslint/component-selector': [
        'error',
        {
          type: 'element',
          prefix: 'app',
          style: 'kebab-case',
        },
      ],
      // import rules
      'import/no-unresolved': 'off',
      'import/namespace': 'off',
      'import/default': 'off',
      'import/export': 'off',
      'import/newline-after-import': 'error',
      'import/order': [
        'error',
        {
          alphabetize: {order: 'asc'},
          "newlines-between": "never"
        },
      ],
    },
  },
  {
    files: ['**/*.spec.ts'],
    languageOptions: {
      globals: {
        ...globals.jasmine,
      },
    },
  },
];

{
  "database": {
    "rules": "test/database.rules.json"
  },
  "firestore": {
    "rules": "test/firestore.rules",
    "indexes": "test/firestore.indexes.json"
  },
  "storage": {
    "rules": "test/storage.rules"
  },
  "emulators": {
    "auth": {
      "port": 9098
    },
    "functions": {
      "port": 5001
    },
    "firestore": {
      "port": 8089
    },
    "database": {
      "port": 9002
    },
    "storage": {
      "port": 9199
    },
    "ui": {
      "enabled": false
    }
  },
  "functions": [
    {
      "source": "test/functions",
      "codebase": "default",
      "ignore": [
        "node_modules",
        ".git",
        "firebase-debug.log",
        "firebase-debug.*.log",
        "*.local"
      ],
      "predeploy": [
        "npm --prefix \"$RESOURCE_DIR\" run build"
      ]
    }
  ]
}

const dns = require('node:dns');

// The emulator suite fails in CI, only on Node 18.
// This apparently fixes it.
// https://github.com/firebase/firebase-tools/issues/5755#issuecomment-1535445383
dns.setDefaultResultOrder('ipv4first');

let firestoreEmulatorPort, storageEmulatorPort, authEmulatorPort, databaseEmulatorPort, functionsEmulatorPort;
if (process.env.FIRESTORE_EMULATOR_HOST &&
    process.env.STORAGE_EMULATOR_HOST &&
    process.env.FIREBASE_AUTH_EMULATOR_HOST &&
    process.env.FIREBASE_DATABASE_EMULATOR_HOST) {
      firestoreEmulatorPort = parseInt(process.env.FIRESTORE_EMULATOR_HOST.split(":")[1], 10); // '127.0.0.1:9098'
      storageEmulatorPort = parseInt(process.env.STORAGE_EMULATOR_HOST.split(":")[2], 10); // 'http://127.0.0.1:9199'
      authEmulatorPort = parseInt(process.env.FIREBASE_AUTH_EMULATOR_HOST.split(":")[1], 10); // '127.0.0.1:9098'
      databaseEmulatorPort = parseInt(process.env.FIREBASE_DATABASE_EMULATOR_HOST.split(":")[1], 10); // '127.0.0.1:9002'
      functionsEmulatorPort = 5001; // TODO figure out why this env variable isn't present
} else {
  console.error("Missing emulator environments variables");
  process.exit(1);
}

// Karma configuration file, see link for more information
// https://karma-runner.github.io/1.0/config/configuration-file.html
module.exports = function (config) {
  config.set({
    basePath: '',
    frameworks: ['jasmine', '@angular-devkit/build-angular'],
    plugins: [
      require('karma-jasmine'),
      require('karma-chrome-launcher'),
      require('karma-safarinative-launcher'),
      require('karma-firefox-launcher'),
      require('karma-jasmine-html-reporter'),
      require('karma-coverage-istanbul-reporter'),
      require('@angular-devkit/build-angular/plugins/karma')
    ],
    client: {
      clearContext: false, // leave Jasmine Spec Runner output visible in browser
      args: [
        ["FIRESTORE_EMULATOR_PORT", firestoreEmulatorPort],
        ["DATABASE_EMULATOR_PORT", databaseEmulatorPort],
        ["STORAGE_EMULATOR_PORT", storageEmulatorPort],
        ["AUTH_EMULATOR_PORT", authEmulatorPort],
        ["FUNCTIONS_EMULATOR_PORT", functionsEmulatorPort],
      ],
    },
    coverageIstanbulReporter: {
      dir: `${process.cwd()}/coverage`,
      reports: ['html', 'lcovonly'],
      fixWebpackSourcePaths: true
    },
    reporters: ['progress', 'kjhtml'],
    port: 9876,
    colors: true,
    logLevel: config.LOG_INFO,
    autoWatch: true,
    browsers: ['Chrome', 'ChromeHeadless', 'SafariNative', 'Firefox', 'FirefoxHeadless'],
    singleRun: false,
    restartOnFileChange: true,
    customLaunchers: {
      FirefoxHeadless: {
        base: 'Firefox',
        flags: [
          '-headless',
        ],
      }
    },
  });
};

